  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC ADMINISTRATIVE RELEASES 33-8252, 34-48178 AND IA RELEASE 40-2147 - THE COMMISSION INSTITUTED PUBLIC ADMINISTRATIVE AND CEASE-AND-DESIST PROCEEDINGS ALLEGING THAT THE DEFENDANTS DEFRAUDED TWENTY-NINE OF THEIR CUSTOMERS AND CLIENTS BY OMITTING MATERIAL FACTS IN CONNECTION WITH THE SALE OF CLASS B SHARES OF MUTUAL FUNDS. THE DIVISION OF ENFORCEMENT (\"THE DIVISION\") ALLEGES THAT BETWEEN 1998 AND 2001, THE DEFENDANTS REPEATEDLY RECOMMENDED THAT THEIR CUSTOMERS INVEST $250,000 OR MORE IN CLASS B SHARES OF A SINGLE FAMILY OF MUTUAL FUNDS, WHICH PAID HIGHER COMMISSIONS THAN CLASS A SHARES OF THE SAME MUTUAL FUNDS, WITHOUT DISCLOSING, AMONG OTHER THINGS, THAT CLASS A SHARES OF THOSE MUTUAL FUNDS WOULD OUTPERFORM CLASS B SHARES FOR INVESTMENTS OF $250,000 OR MORE.",
  "Resolution" : "Order",
  "SanctionDetails" : [ {
    "Sanctions" : "Disgorgement/Restitution"
  }, {
    "Sanctions" : "Cease and Desist/Injunction"
