  "Sanction Details" : "OPINION OF THE COMMISSION RELEASE 34-54127 AND IA RELEASE 40-2533, JULY 11, 2006; ORDERED THAT WILLIAM KISSINGER CEASE AND DESIST FROM COMMITTING ANY VIOLATIONS OR FUTURE VIOLATIONS OF SECTION 17(A)(2) AND 17(A)(3) OF THE SECURITIES ACT OF 1933; AND IT IS FURTHER ORDERED THAT KISSINGER DISGORGE THE AMOUNT OF $36,170, PLUS PREJUDGMENT INTEREST, AS CALCULATED IN ACCORDANCE WITH COMMISSION RULE OF PRACTICE 600; DECISION FINAL ON SEPTEMBER 8, 2006.",
  "Broker Comment" : "ON JULY 11, 2006 THE SECURITIES AND EXCHANGE COMMISSION (THE \"COMMISSION\") ISSUED AN OPINION IN IN THE MATTER OF  IFG NETWORK SECURITIES, INC., WILLIAM KISSINGER, AND [THIRD PARTY], (ADMIN. PROC. FILE NO. 3-11179).  THAT CASE INVOLVED AN APPEAL BY THE DIVISION OF ENFORCEMENT FROM THE DECISION OF AN ADMINISTRATIVE LAW JUDGE DISMISSING THE CHARGES THAT I,  (\"KISSINGER\") VIOLATED THE FEDERAL SECURITIES LAWS IN CONNECTION WITH THE SALE OF CLASS B MUTUAL FUNDS TO SIX OF MY MORE THAN 1,000 CLIENTS.  THE COMMISSION DETERMINED THAT THE INFORMATION PROVIDED BY ME TO MY CLIENTS WAS ACCURATE.  NONETHELESS, THE COMMISSION FOUND THAT I NEGLIGENTLY OMITTED TO DISCLOSE CERTAIN MATERIAL INFORMATION TO THESE CLIENTS RELATING TO THE RECOMMENDATION OF CLASS B MUTUAL FUNDS, THEREBY CONSTITUTING A VIOLATION OF SECTIONS 17(A)(2) AND 17(A)(3) OF THE SECURITIES ACT OF 1933 (THE \"ACT\").  THE COMMISSION REJECTED THE DIVISION OF ENFORCEMENT'S REQUEST THAT I BE BARRED AND/OR SUSPENDED FROM THE SECURITIES INDUSTRY, AND REFUSED TO IMPOSE ANY CIVIL PENALTIES AGAINST ME.  THE COMMISSION ORDERED THAT I DISGORGE THE AMOUNT OF $36,170, AND THAT I CEASE AND DESIST FROM COMMITTING ANY FUTURE VIOLATIONS OF SECTION 17(A)(2) AND 17(A)(3) OF THE ACT."
}
